import './App.css';
import Navbar from './components/Navbar';
import {BrowserRouter,Route, Router} from "react-router-dom";


function App() {
  return (
    <div className="App">

<BrowserRouter>

  <Router>
    <Route exact path="/" elements={ <Navbar/> } />
    <Route exact path="/all" elements={ <Navbar/> } />
    <Route exact path="/update" elements={ <Navbar/> } />
  </Router>

</BrowserRouter>

      {/* <Navbar /> */}
        Hello World
        <br/>
        <button className="btn btn-success">Btn</button>
    </div>
  );
}

export default App;
